  false,\n\t\"url\": null,\n\t\"notes\": \"The DLG data files used to create this
  dataset are derived from the 1:2,000,000-scale maps contain selected base categories
  of cartographic data in digital form. The data files are derived from the sectional
  maps of the 1970 National Atlas of the United States of America. The Hydrography
  category includes data in three separate subcategories: (1) Streams, (2) Water Bodies,
  and (3) Hypsography (Continental Divide only). This file contains only data pertaining
